import React from 'react'
import "./Login.css";
import Button from ""

function Login() {
    return (
			<div className='login'>
				<div className='login__container'>
					<img
						src='https://logos-world.net/wp-content/uploads/2020/11/Gmail-Logo.png'
						alt=''
                />
                <Button>Login</Button>
				</div>
			</div>
		);
}

export default Login;
